import React from 'react'
import './modal.css'

export default function Modal({ isOpen }) {

    if (isOpen) {
        return (
            <div className="Modal_background">
                <div className="Modal_box">
                    <div>Invalid Input</div>
                    <div>Please enter a valid Input</div>
                    <div><button>Okay</button></div>
                </div>
            </div>
        )
    }
    return null
}
